import '../styles/Home/Home.css'

const Home = () => {

    return (
        <>
        <div className="home_body">
            <section className="intro_words">
                <div id="revelio_word">
                    <h1>Revelio.</h1>
                </div>
            </section>
        </div>
        </>
    )
}

export default Home
